//session外部API接口处理回调
var sessiondo = {};
sessiondo.get = function (sid,path,func){
  var dox = require(path);
  dox.get(sid,function(result){
    var a = result;
    func(a);
  });
};
sessiondo.set = function (path,sid,arr){
  var dox = require(path);
  dox.set(sid,arr);
};

exports = module.exports = sessiondo;